import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div style={this.getstyles()}>
        <h1>terve</h1>
        <button>Uusi kalenteri</button>
      </div>
    );
  }

  getstyles() {
    let styles = "background-color: Blue";
    return styles;
  }
}

export default Navbar;
